import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import { NotFound, Dashboard, CreateWod } from './components';
function App() {
  return (

      <div>
        <Route path="/" component={Dashboard}></Route>
        <Route path="/create" component={CreateWod}></Route>
      </div>
      );
  }

export default App;
